import React from "react";
import Header from "./components/Header";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";

import './App.css';

function App() {
  return (
    <div className="App">
      <Header/>
      <Navbar/>
     <h1>React App</h1>
     <Footer/>
    </div>
  );
}

export default App;
